-- ----------------------------
-- Procedure structure for `UpdateJourForMatricule`
-- ----------------------------
DROP PROCEDURE IF EXISTS `UpdateJourForMatricule`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `UpdateJourForMatricule`(IN matricule VARCHAR(122))
BEGIN
    DECLARE min_time TIME;
    DECLARE max_time TIME;
    DECLARE start_date DATE;
    DECLARE end_date DATE;

    
    DECLARE cur CURSOR FOR
    SELECT MIN(TIME(Temps)), MAX(TIME(Temps)), DATE(MIN(Temps)), DATE(MAX(Temps))
    FROM Pointeuse
    WHERE Matricule = matricule;

    OPEN cur;
    FETCH cur INTO min_time, max_time, start_date, end_date;

    
    VALUES (NULL, start_date, end_date, min_time, max_time)
    ON DUPLICATE KEY UPDATE
    Jour_Debut = VALUES(Jour_Debut),
    Jour_Fin = VALUES(Jour_Fin),
    Heure_Debut = VALUES(Heure_Debut),
    Heure_Fin = VALUES(Heure_Fin);

    CLOSE cur;
END
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `after_insert_pointeuse`;
DELIMITER ;;
CREATE TRIGGER `after_insert_pointeuse` AFTER INSERT ON `pointeuse` FOR EACH ROW BEGIN
    DECLARE min_time TIME;
    DECLARE max_time TIME;
    DECLARE start_date DATE;
    DECLARE end_date DATE;
    
    
    SET start_date = DATE(NEW.Temps);
    SET end_date = DATE(NEW.Temps);

    
    SELECT MIN(TIME(Temps)), MAX(TIME(Temps))
    INTO min_time, max_time
    FROM Pointeuse
    WHERE Matricule = NEW.Matricule
      AND DATE(Temps) = start_date;

    
    IF EXISTS (SELECT 1 FROM Pointeuse WHERE Matricule = NEW.Matricule AND DATE(Temps) = start_date AND TIME(Temps) = '00:01') THEN
        SET min_time = TIME((SELECT MIN(Temps) FROM Pointeuse WHERE Matricule = NEW.Matricule AND DATE(Temps) = start_date AND TIME(Temps) != '00:01'));
        SET max_time = TIME((SELECT MAX(Temps) FROM Pointeuse WHERE Matricule = NEW.Matricule AND DATE(Temps) = start_date AND TIME(Temps) != '00:01'));
    END IF;

    
    VALUES (NEW.idPointeuse, start_date, end_date, min_time, max_time);
END
;;
DELIMITER ;
